import CarouselBox from "./CarouselBox";

function FrequentlyAskedBox() {

    return (
    <div className="DecreaseTopMargin DarkGreenBox">
        <div className="LightGreenBox ">
          <h2 className="LightLine LightGreenFontShade FullWidthContainer LineTextLine CursiveFont MdFont">
            Frequently Asked
          </h2>

          <div className='container DecreaseTopMargin'>
          <CarouselBox />

          </div>
        </div> 
        <div className="LineTextLine LightLine" ></div>
    </div>
 );
}

export default FrequentlyAskedBox;
